import React from "react";
import styled from "styled-components";

const Orb = () => {
  const OrbStyled = styled.div`
    width: 70vh;
    height: 70vh;
    position: absolute;
    border-radius: 50%;
    margin-left: -37vh;
    margin-top: -37vh;
    background: linear-gradient(180deg, #f56692 0%, #f2994a 100%);
    filter: blur(1000px);
  `;
  return <OrbStyled></OrbStyled>;
};

export default Orb;
